import React from "react";

import eye from "../assets/icons/eye.svg";

const ViewButton = ({ href }) => {
  return (
    <a
      href={href}
      download="cac_document"
      target="_blank"
      className="flex items-center bg-darkBlue px-4 md:px-8 cursor-pointer rounded-md py-2"
    >
      <img src={eye} alt="eye" />
      <p className="text-white font-bold text-[8px] md:text-xs pl-2">
        Click Here to View
      </p>
    </a>
  );
};

export { ViewButton };
